function HandleClick() {

}



function EmButton() {
    const navigation = useNavigate();
    ////onClick={()=>useNavigate("")}
    return (

        <button className='btn' onClick={()=>navigation('/emergency')}>
            Emergency
        </button>
    );
}
function LogButton(){
    return (<button className='mtl'>
            Log In
        </button>
    );
}

export default function MyApp() {
    return (
        <div className='first'>
            <Header/>
            <EmButton />
            <div className='sec'>
                <LogButton />
            </div>
        </div>
    );
}
